        line = stdin.split()
        segments.append((int(line[0]), int(line[1])))
    segments.sort(key=lambda x: x[0])

    def merge_intervals(intervals: list):
        result = [intervals[0]]
        for interval in intervals[1:]:
            if interval[0] > result[-1][1]:
                result.append(interval)
            else:
                result[-1] = (result[-1][0], max(result[-1][1], interval[1]))
        return result

    def find_max_length(intervals: list):
        max_length = 0
        for interval in intervals:
            max_length = max(max_length, interval[1] - interval[0] + 1)
        return max_length

    def remove_segment(intervals: list, i: int):
        intervals[i] = (intervals[i][1], intervals[i][1])
        return merge_intervals(intervals)

    def intersect(intervals: list):
        return merge_intervals(intervals)

    intervals = [(0, 10**9)]
    for i in range(n):
        intervals = remove_segment(intervals, i)
        if len(intervals) == 1:
            return str(intervals[0][1] - intervals[0][0] + 1)
        if len(intervals) == 0:
            return "0"

    max_length = 0
    for i in range(n):
        for j in range(i + 1, n):
            intervals = intersect(intervals)
            max_length = max(max_length, find_max_length(intervals))
            intervals = remove_segment(intervals, i)
            intervals = remove_segment(intervals, j)

    return str(max_length)

