    counts = [0] * len(factors)
    for i in range(2, int(N**0.5)+1):
        if N % i == 0:
            counts[factors.index(i)] += 1
            while N % i == 0:
                N //= i
            if N > 1:
                counts[factors.index(N)] += 1

    # Finally, we will multiply all the counts to get the final answer
    result = 1
