                if 0 <= new_r < len(puzzle) and 0 <= new_c < len(puzzle[0]) and (new_r, new_c) not in visited:
                    visited.add((new_r, new_c))
                    queue.append((new_r, new_c))

        # Find the lexicographically smallest word
