    def move_up(xs: list[tuple[float, float]]) -> None:
        x0, y0 = xs[0]
        xs = [(-x0, y0)] + xs[1:]

    def move_down(xs: list[tuple[float, float]]) -> None:
        x0, y0 = xs[-1]
        xs = [(x0, -y0)] + xs[:-1]

    def move_right(xs: list[tuple[float, float]]) -> None:
        y0, x0 = xs[0]
        xs = [(x0, -y0)] + xs[1:]

    def move_left(xs: list[tuple[float, float]]) -> None:
        y0, x0 = xs[-1]
        xs = [(x0, y0)] + xs[:-1]

    def max_x(xs: list[tuple[float, float]]) -> float:
        return max(x for _, x in xs)

    def min_x(xs: list[tuple[float, float]]) -> float:
        return min(x for _, x in xs)

    def max_y(xs: list[tuple[float, float]]) -> float:
        return max(y for x, _ in xs)

    def min_y(xs: list[tuple[float, float]]) -> float:
        return min(y for x, _ in xs)

    def aspect_ratio(xs: list[tuple[float, float]]) -> float:
        max_x = max_x(xs)
        min_y = min_y(xs)
        min_x = min_x(xs)
        if min_x == 0:
            return 1
        else:
            return (max_y - min_y) / (max_x - min_x)

    for _ in range(n):
        xs = [(x, y) for x, y in xs]
        area = abs(sum(x * y for x, y in zip(*xs)))

        if area >= a:
            move_up(xs)
        else:
            move_down(xs)

        if aspect_ratio(xs) <= 1:
            move_right(xs)
        else:
            move_left(xs)

        xs = [(x + xs[0][0], y + xs[0][1]) for x, y in xs]

    return "\n".join(f"{x:.6f} {y:.6f}" for x, y in xs)

