    n, s = map(int, stdin.split())

    holes = [tuple(map(int, stdin.split())) for _ in range(n)]

    def distance(p1: tuple, p2: tuple) -> float:
        return ((p1[0] - p2[0]) ** 2 + (p1[1] - p2[1]) ** 2 + (p1[2] - p2[2]) ** 2) ** 0.5

    def closest_point(p1: tuple, p2: tuple) -> tuple:
        d1 = distance(p1, p2)
        d2 = distance(p2, p1)
        if d1 < d2:
            return p1
        else:
            return p2

    def closest_points(p1: tuple, p2: tuple, p3: tuple) -> tuple:
        p4 = closest_point(p2, p3)
        p5 = closest_point(p3, p1)
        p6 = closest_point(p1, p2)

        if distance(p4, p5) < distance(p4, p6):
            return p4, p5, p6
        else:
            return p5, p4, p6

    def triangle_area(p1: tuple, p2: tuple, p3: tuple) -> float:
        return 0.5 * abs((p1[0] - p2[0]) * (p2[1] - p3[1]) - (p2[0] - p3[0]) * (p1[1] - p2[1]))

    def are_colliding(p1: tuple, p2: tuple) -> bool:
        return triangle_area(p1, p2, (0, 0, 0)) < 0

    def point_in_triangle(point: tuple, triangle: tuple) -> bool:
        p1, p2, p3 = triangle
        a = triangle_area(p1, p2, p3)
        if abs(a) < 1e-6:
            return True

        b = triangle_area(p1, p3, point)
        c = triangle_area(p2, p3, point)

        return abs(b + c) < abs(a)

    def cut_cheese(holes: list) -> tuple:
        slices = [tuple([0, 0, 0])]
        for hole in holes:
            d = distance(hole, slices[-1])
            while slices[-1][2] < hole[2]:
                slices.append(closest_points(slices[-1], hole, (0, 0, slices[-1][2] + d)))

        return tuple(slice[0][2] - slice[1][2] for slice in slices)

    slices = cut_cheese(holes)
    return " ".join(map(str, slices))

