        if grid[i][j] == 'C':
            return False

        return True

    def island_size(i, j, nrows, ncols):
        size = 1
        stack = [(i, j)]
        while stack:
            curr_i, curr_j = stack.pop()
            if not is_connected(curr_i, curr_j, nrows, ncols):
                continue

            grid[curr_i][curr_j] = 'C'

            if curr_i > 0:
                stack.append((curr_i - 1, curr_j))
            if curr_i < nrows - 1:
                stack.append((curr_i + 1, curr_j))
            if curr_j > 0:
                stack.append((curr_i, curr_j - 1))
            if curr_j < ncols - 1:
                stack.append((curr_i, curr_j + 1))

            size += 1

        return size

    def find_islands(nrows, ncols):
        islands = 0
        for i in range(nrows):
            for j in range(ncols):
                if grid[i][j] == 'L':
                    size = island_size(i, j, nrows, ncols)
                    if size > 0:
                        islands += 1

        return islands

    return str(find_islands(rows, cols))

