    students = list(map(int, stdin.split()[1:]))

    # find the maximum number of exams in each room
    max_exams_in_room = max(students)
    if max_exams_in_room > 2:
        return "impossible"

    # find a safe order in which to visit the rooms
    visited = [False] * n
    order = []
    queue = [(0, [])]
    while queue:
        room_index, room_exams = queue.pop(0)
        for exam in room_exams:
            if not visited[exam]:
                visited[exam] = True
                if exam == max_exams_in_room:
                    order.append(exam)
                else:
                    queue.append((exam, room_exams + [exam]))

    # output the safe order
    return " ".join(map(str, order))

